// pass the information from one com[ponent to another component
// declare -- {}
// props are immutable -- we cant able to update 

// destructuring -- multines props to make  sinlge ;line props
// prop-types -- used to validate the data types 

function App(Props){
    return(
        <div>
            <p>
                Name:{props.name}<br/>
                city:{props.city}<br/>
                age:{props.age}<br/>
                state:{props.state}

            </p>

        </div>
    )
}
function Prop(){
    return(
        <div>
            <App Name="vijay" city="bnglr" age="25" state="karnataka"/>
        </div>
    )
}
export default prop;
